import React from 'react'


function ClickEventF() {
    function EventClick(){
        alert('Hello Click Event');
    }
    return (<div>
            <button onClick={EventClick}>Click Me F</button>
            <h3>ClickEvent funtional components. Thank you ClickEventF page.</h3>
        </div>
    );
}
export default ClickEventF;
